                    tmp.append(nums[j])
                    j += 1
            while i <= mid:
                tmp.append(nums[i])
                i += 1
            while j <= right:
                tmp.append(nums[j])
                j += 1
            for i in range(left, right + 1):
                nums[i] = tmp[i - left]
            return count

        def mergeSort(nums, left, right):
            if left >= right:
                return 0
            mid = (left + right) // 2
            count = mergeSort(nums, left, mid) + mergeSort(nums, mid + 1, right)
